sealed class AuthException(message: String): kotlin.Exception(message) {
        
        class InvalidSignature(message: String) : AuthException(message)
        
        class TokenExpired(message: String) : AuthException(message)
        
        class Unauthorized(message: String) : AuthException(message)
        
        class NotInitialised(message: String) : AuthException(message)
        

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<AuthException> {
        override fun lift(error_buf: RustBuffer.ByValue): AuthException = FfiConverterTypeAuthError.lift(error_buf)
    }
}

/**
 * @suppress
 */
public object FfiConverterTypeAuthError : FfiConverterRustBuffer<AuthException> {
    override fun read(buf: ByteBuffer): AuthException {
        
            return when(buf.getInt()) {
            1 -> AuthException.InvalidSignature(FfiConverterString.read(buf))
            2 -> AuthException.TokenExpired(FfiConverterString.read(buf))
            3 -> AuthException.Unauthorized(FfiConverterString.read(buf))
            4 -> AuthException.NotInitialised(FfiConverterString.read(buf))
